chrome.devtools.network.onRequestFinished.addListener(
  function(request) {
    if(request.request.url.match(/data:image/g)){
      if(pokemons[request.request.url]){
        found_pokemon = pokemons[request.request.url];
        if(important_pokemons[found_pokemon]){
          chrome.devtools.inspectedWindow.eval('console.log("'+found_pokemon+' gefunden")');
          var snd = new Audio("sounds/important.mp3"); // buffers automatically when created
          snd.play();
        }
      }else {
        chrome.devtools.inspectedWindow.eval('console.log("unbekannter Pokemon-Download entdeckt: " + unescape("' +escape(request.request.url) + '"))');
        var snd = new Audio("sounds/new.mp3"); // buffers automatically when created
        snd.play();
      }
    }
  }
);